import { configureStore } from "@reduxjs/toolkit";
// Importez vos slices ici
import userReducer from "./slices/userSlice";

const store = configureStore({
  reducer: {
    user: userReducer,
    // Ajoutez d'autres réducteurs de slice ici
  },
});

export default store;
